=head1 DESCRIPTION

A structure that contains the C<Timestamp>, C<Error>, and
C<ImageContent>.

=head1 ATTRIBUTES


=head2 Error => Str

The error message shown when the image for the provided timestamp was
not extracted due to a non-tryable error. An error will be returned if:

=over

=item *

There is no media that exists for the specified C<Timestamp>.

=back

=over

=item *

The media for the specified time does not allow an image to be
extracted. In this case the media is audio only, or the incorrect media
has been ingested.

=back



=head2 ImageContent => Str

An attribute of the C<Image> object that is Base64 encoded.


=head2 TimeStamp => Str

An attribute of the C<Image> object that is used to extract an image
from the video stream. This field is used to manage gaps on images or
to better understand the pagination window.



